create table Prospect (
	activated VARCHAR(50),
	t_number VARCHAR(50),
	first_name VARCHAR(50),
	middle_name VARCHAR(50),
	last_name VARCHAR(50),
	term VARCHAR(6),
	level VARCHAR(9),
	primary_department VARCHAR(22),
	primary_program VARCHAR(50),
	secondary_department VARCHAR(22),
	secondary_program VARCHAR(50),
	decision VARCHAR(24),
	admit_date DATE,
	street_address_1 VARCHAR(50),
	street_address_2 VARCHAR(50),
	street_address_3 VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	zip_code VARCHAR(50),
	phone_number VARCHAR(50),
	email_address VARCHAR(50),
	ualr_email VARCHAR(50),
	ethnicity VARCHAR(50),
	sex VARCHAR(50),
	admission_type VARCHAR(11),
	student_type VARCHAR(26)
);
